import React, { useState, useEffect } from 'react';
import {
  Container,
  Paper,
  Box,
  TextField,
  Button,
  Typography,
  Link,
  Alert,
  CircularProgress,
} from '@mui/material';
import { useNavigate, Link as RouterLink } from 'react-router-dom';
import { useAppDispatch, useAppSelector } from '../hooks/redux';
import { login, clearError } from '../store/slices/authSlice';

const LoginPage: React.FC = () => {
  const navigate = useNavigate();
  const dispatch = useAppDispatch();
  const { isLoading, error, isAuthenticated } = useAppSelector((state) => state.auth);

  const [formData, setFormData] = useState({
    email: '',
    password: '',
  });

  useEffect(() => {
    if (isAuthenticated) {
      navigate('/dashboard');
    }
  }, [isAuthenticated, navigate]);

  useEffect(() => {
    dispatch(clearError());
  }, [dispatch]);

  const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    dispatch(login(formData));
  };

  return (
    <div style={{ 
      backgroundColor: '#f5f5f5', 
      minHeight: '100vh', 
      display: 'flex', 
      alignItems: 'center', 
      justifyContent: 'center',
      padding: '20px'
    }}>
      <Container component="main" maxWidth="xs">
        <Paper
          elevation={3}
          style={{
            padding: '32px',
            backgroundColor: '#ffffff',
            borderRadius: '8px',
            textAlign: 'center'
          }}
        >
          <Typography
            variant="h4"
            style={{
              color: '#6366f1',
              fontWeight: 'bold',
              marginBottom: '24px'
            }}
          >
            LETZ
          </Typography>

          <Typography 
            variant="h5"
            style={{
              color: '#000000',
              fontWeight: '600',
              marginBottom: '24px'
            }}
          >
            Entrar
          </Typography>

          {error && (
            <Alert severity="error" style={{ marginBottom: '16px' }}>
              {error}
            </Alert>
          )}

          <form onSubmit={handleSubmit}>
            <TextField
              margin="normal"
              required
              fullWidth
              id="email"
              label="Email"
              name="email"
              autoComplete="email"
              autoFocus
              value={formData.email}
              onChange={handleChange}
              disabled={isLoading}
              InputProps={{
                style: {
                  backgroundColor: '#ffffff',
                  color: '#000000',
                }
              }}
              InputLabelProps={{
                style: {
                  color: '#6b7280',
                }
              }}
              sx={{
                '& .MuiOutlinedInput-root': {
                  backgroundColor: '#ffffff !important',
                  '& input': {
                    color: '#000000 !important',
                  },
                  '& fieldset': {
                    borderColor: '#d1d5db !important',
                  },
                  '&:hover fieldset': {
                    borderColor: '#6366f1 !important',
                  },
                  '&.Mui-focused fieldset': {
                    borderColor: '#6366f1 !important',
                  },
                },
                '& .MuiInputLabel-root': {
                  color: '#6b7280 !important',
                  '&.Mui-focused': {
                    color: '#6366f1 !important',
                  },
                },
              }}
            />

            <TextField
              margin="normal"
              required
              fullWidth
              name="password"
              label="Senha"
              type="password"
              id="password"
              autoComplete="current-password"
              value={formData.password}
              onChange={handleChange}
              disabled={isLoading}
              InputProps={{
                style: {
                  backgroundColor: '#ffffff',
                  color: '#000000',
                }
              }}
              InputLabelProps={{
                style: {
                  color: '#6b7280',
                }
              }}
              sx={{
                '& .MuiOutlinedInput-root': {
                  backgroundColor: '#ffffff !important',
                  '& input': {
                    color: '#000000 !important',
                  },
                  '& fieldset': {
                    borderColor: '#d1d5db !important',
                  },
                  '&:hover fieldset': {
                    borderColor: '#6366f1 !important',
                  },
                  '&.Mui-focused fieldset': {
                    borderColor: '#6366f1 !important',
                  },
                },
                '& .MuiInputLabel-root': {
                  color: '#6b7280 !important',
                  '&.Mui-focused': {
                    color: '#6366f1 !important',
                  },
                },
              }}
            />

            <Button
              type="submit"
              fullWidth
              variant="contained"
              disabled={isLoading}
              style={{
                marginTop: '24px',
                marginBottom: '16px',
                backgroundColor: '#6366f1',
                color: '#ffffff',
                padding: '12px',
                fontSize: '16px',
                fontWeight: '600'
              }}
            >
              {isLoading ? (
                <CircularProgress size={24} color="inherit" />
              ) : (
                'Entrar'
              )}
            </Button>

            <div style={{ textAlign: 'center' }}>
              <Link 
                component={RouterLink} 
                to="/register" 
                variant="body2"
                style={{
                  color: '#6366f1',
                  textDecoration: 'none',
                }}
              >
                Não tem uma conta? Cadastre-se
              </Link>
            </div>
          </form>
        </Paper>

        <Paper
          elevation={1}
          style={{
            marginTop: '16px',
            padding: '16px',
            backgroundColor: '#f9fafb',
            borderRadius: '8px'
          }}
        >
          <Typography 
            variant="subtitle2" 
            style={{ 
              color: '#000000',
              fontWeight: 'bold',
              marginBottom: '8px'
            }}
          >
            Usuários de Teste:
          </Typography>
          <Typography 
            variant="caption" 
            style={{ 
              color: '#374151',
              display: 'block'
            }}
          >
            <strong>Admin:</strong> admin@letz.com / admin123
          </Typography>
          <Typography 
            variant="caption" 
            style={{ 
              color: '#374151',
              display: 'block'
            }}
          >
            <strong>João:</strong> joao@exemplo.com / admin123
          </Typography>
          <Typography 
            variant="caption" 
            style={{ 
              color: '#374151',
              display: 'block'
            }}
          >
            <strong>Maria:</strong> maria@exemplo.com / admin123
          </Typography>
        </Paper>
      </Container>
    </div>
  );
};

export default LoginPage;
